1. **Convert the numbers from base \( b \) to base 10:**
   - \( 17_b = 1 \cdot b + 7 = b + 7 \)
   - \( 97_b = 9 \cdot b + 7 = 9b + 7 \)

2. **Set up the divisibility condition:**
   \[
   b + 7 \mid 9b + 7
   \]

3. **Express the divisibility condition:**
   \[
   9b + 7 = k(b + 7)
   \]
   for some integer \( k \).

